    return(
        <div className="post">
          <img src="data:image/jpeg;base64,"></img>
          <div className="texts">
          <h2>{title}</h2>
          <p className="info">
            <a className="author">Mashi Bann</a>
            <time>{createdAt.replaceAll()}</time>
          </p>
          <p className="summary">{summary}</p>
          </div>
        </div>
    );
}
